# A="110110"
# B="011011"

A=''
B=''

m=len(A)

text=B+B
print(text)

#creating Longest prefix LPS of A
i,j=0,1
lps=[0]*m
while j < m:
    if A[i]==A[j]:
        i+=1
        lps[j]=i
        #i+=1
        j+=1
    else:
        if i>0:
            i=lps[i-1]
        else:
            j+=1

print(lps)

#KMP String Pattern Matching / Z algorithm
ans=0
n=len(text)
i=0
j=1
while j < n:
    if A[i]==text[j]:
        i+=1
        j+=1

    if i==m:
        ans+=1
        i=lps[i-1]

    elif j < n and A[i] != text[j]:
        if i!=0:
            i = lps[i-1]
        else:
            j+=1

print(ans)


























